import React, { useReducer } from 'react';
import './App.css';
import ComponentB from './components/ComponentB';
import ComponentA from './components/ComponentA';
import ComponentC from './components/ComponentC';

function App() {
  return (
    <div className="App">
      <ComponentA />
      <ComponentB />
      <ComponentC />
    </div>
  );
}

export default App;
